const Tabs = (props) => {
    const tabClick= (cur)=>{
        return console.log(cur)
    }
    return (
        <>
            {
                props.button.map((cur,index) => {
                    return <>
                        <button className='tab-button text-[16px] font-[400] leading-[1.5em] text-[#212529] mr-[30px]' data={`tab_${index}`} onClick={() => tabClick(cur)} >{cur}</button>

                    </>
                })
            }
        </>
    )
}


const TabsContent = (props) => {
    return (
        <>
            {
                props.Content.map((cur,index) => {
                    return <>
                        <div className="tab-content" id={`tab_${index}`}>
                            {cur}
                        </div>

                    </>
                })
            }
        </>
    )
}

export  { Tabs, TabsContent }
